const int N = 30;
const int LL = 10;
const float Nf =20.;
const int Nrand =100;
const float Nrandf =100.;
const float PI =3.1415926;

in vec2 u;
out vec4 cout;

uniform vec2 L;
uniform highp sampler2D img;
uniform float rand[Nrand];

uniform float kl[N];
uniform float ax[LL];
uniform float ay[LL];
uniform float az[LL];
uniform vec3 v;

float s1,c1,xe,ye,ze,Nrad,clarity,wf0,rr00,lgfac,wild,inv,night,lo,phase,rain,famp,kkx,kky,scalefac,ox,oy,rv;
int nn; vec3 rlight;

vec2 proj( in vec3 v, in vec3 ve, in vec2 tt) {
  float c = ve.z/(ve.z+v.z);
  return vec2((v.x-ve.x + tt[0]*v.z)*c, (v.y-ve.y + tt[1]*v.z)*c);
}
float dot3( in vec3 v, in vec3 w) { return v[0]*w[0] + v[1]*w[1] + v[2]*w[2]; }
vec3 rot3d( in vec3 v, in vec3 k, in float theta) { // rotation of vector v about axis k, angle t with Rodrigues formula:
  return v*cos(theta)+cross(k,v)*sin(theta)+k*dot3(k,v)*(1.-cos(theta));
}
float norm3( in vec3 v) { return sqrt(dot3(v,v)); }
vec3 flow( in vec3 r, in vec3 p) {
  return r + vec3(sin(2.*PI*rand[0]+3.*p[0]*r.x),sin(2.*PI*rand[1]+2.*p[1]*r.y),0.)*p[2]/200.;
}

vec2 ccircle(in vec2 uv, in float x, in float y, in float D, in float t1, in float t2) {
  float dx = x-uv.x; float dy = y-uv.y;
  float d = (dx*dx+dy*dy)/(D*D/4.);
return .07*exp(-d*D*D)*float(dy>0.&&dx*dx<.001)*rain+exp(-(2.+6.*kl[0])*d)*vec2(1.,0.);
}

void main(void) {
  c1 = kl[0];
  s1 = kl[1];
  xe = kl[2];
  ye = kl[3];
  ze = kl[4];
  nn = int(kl[5]);
  Nrad = kl[6];
  clarity = kl[7];
  wf0 = kl[8];
  rr00 = kl[9];
  lgfac = kl[10];
  wild = kl[11];
  rlight = vec3(kl[12],kl[13],kl[14]);
  inv = kl[15];
  night = kl[16];
  lo = kl[17];
  phase = kl[18];
  rain = kl[19];
  famp = kl[20];
  kkx = kl[21];
  kky = kl[22];
  scalefac = kl[23];
  ox = kl[24];
  oy = kl[25];
  rv= kl[26];
float mel1 = kl[27];
float mel2 = kl[28];
float count = kl[29];

vec2 uv = u;
vec2 uc = u;

vec4 cc = texture(img,uc);

if (L.x<L.y) {
  uv.y = 0.5 + (L.y/L.x)*(uv.y-0.5);
  uc.y = 0.5 + (L.y/L.x)*(uc.y-0.5);
} else {
  uv.x = 0.5 + (L.x/L.y)*(uv.x-0.5);
  uc.x = 0.5 + (L.x/L.y)*(uc.x-0.5);
}

cout = cc;
//cout.xy*=1. - .02*rain-.02*night;

float dtt = 1.0;

vec3 ve = vec3(xe,ye,ze);
vec3 param = vec3(kkx,kky,famp);
vec2 tt = vec2(c1,s1);
float st=0.;
float cnt=0.;
int thmax = int(Nrad);
for( int j=0; j<nn; j++ ) {
  vec3 p = vec3(ax[j],ay[j],az[j]);
  float wf = wf0*(10.+min(240.,2./(0.005+ay[j])));
  for ( int th=0; th<thmax; th++) {
    cnt++;
