    float ri = clarity + (1.-clarity)*(0.2+0.8*rand[int(mod(cnt,Nrandf))]);
    float ri0 = ri;
    float ri2 = fract(237.*ri);
    float ri3 = fract(191.*ri);
    float ri4 = fract(257.*ri);
    float fac = 1.;
    vec3 pr = flow(p+v1*1./200.*fac*ri*wf,param);
    //vec3 pr = p + .4*v1/200.*fac*wf*ri;
    vec2 p1 = proj(pr,ve,tt);
    float rr = 3.*wf0*(2.-clarity)*rr00*3.; //*ri;
    float aaa = 3.2/Nrad;
    aaa *= 2./(2.-clarity);
    //rr*=1.-count;
    float rref = rr;
    float aref = aaa;
    //aaa *= 1.-4.*az[j];
aaa*=2.;
    vec3 dr = rlight + vec3(xe,ye,ze) - pr;
    float xx = dot3(v1,dr)/length(dr);
    float axx = abs(xx); //axx=min(1.,max(0.,axx));
    dr-= .1*vec3(rand[11],rand[12],rand[13]);//.02*ff.yzx;
    float xx2 = dot3(v1,dr)/length(dr);

    vec2 hsb = vec2(axx,xx2);
    if (xx<0.) {
      hsb*=0.;
      aaa=1.;
    }
    float vv = min(.27,3.*(hsb.x+hsb.y));
    vv *= 1. + 0.25/rr/rr;
    float dt = 0.01*(1.+3.*ri4);
    fac = exp(ri3*2.);
    rr *= .45*fac;
    aaa*= 1.1/fac;
    vv*= 1.-.2*night;
    vv*= 1.-abs(sin(ri));
    vec2 v2 = proj(v1,ve,tt);
    float t1 = phase + 0.1 + .8*atan(v2.y,v2.x);
    if (xx<0.) { t1 += PI; }
    float t2 = t1 + dt;
    t1 -= dt;
    vv*=2.;
    vec4 cc_rgb = vec4(hsb.xy*vv,1.,min(1.,aaa));
//    vec4 cc_line = vec4(0.9,0.2,1.,.2*aaa);
    //      if (rain>0. && xx>0. && st>0.) {rr*=exp(2.*ri4);}
    vec2 cd = ccircle(uc,ox+scalefac*p1.x,1.-oy+scalefac*p1.y,rr/200.,t1,t2);
    cout = mix(cout, cc_rgb,  mel1*cc_rgb.w*cd[0]);
    pr = flow(vec3(p.x,-p.y,p.z)+v1/200.*fac*ri*wf,param);
    p1 = proj(pr,ve,tt);
    cd = ccircle(uc,ox+scalefac*p1.x,1.-oy+scalefac*p1.y,rr/200.,t1,t2);
    cout = mix(cout, cc_rgb, mel1*cc_rgb.w*cd[0]);
  }
}
