const int N = 30;
const int LL = 10;
const float Nf =20.;
const int Nrand =100;
const float Nrandf =100.;
const float dn =0.1;
const int Nx =512;
const float Nxf =512.;
const float PI =3.1415926;
const int numOctaves = 8;//9;
//const float TT = 120.;

in vec2 u;
out vec4 cout;

uniform vec2 res;
uniform vec2 L;
uniform float t; // frame number
uniform highp sampler2D img;
uniform highp sampler2D img00;
uniform float kp[N];
uniform float rand[Nrand];
uniform vec3 dxy;
uniform vec3 rc;

vec2 hash2( in vec2 x ) {
  int ii = int(mod(x.x+res.x*x.y,Nrandf)); //counter into array of random #s
  int i2 = int(mod(x.y-res.y*x.x,Nrandf)); //counter into array of random #s
  return vec2(rand[ii],rand[i2]);
}
float ddot ( in vec2 x, in vec2 y ) { return x.x+y.x + x.y*y.y; }
vec3 noise( in vec2 p ) {
    vec2 i = floor( p );
    vec2 f = fract( p );

    vec2 u = f*f*f*(f*(f*6.0-15.0)+10.0);
    vec2 du = 30.0*f*f*(f*(f-2.0)+1.0);

    vec2 ga = hash2( i + vec2(0.0,0.0) );
    vec2 gb = hash2( i + vec2(1.0,0.0) );
    vec2 gc = hash2( i + vec2(0.0,1.0) );
    vec2 gd = hash2( i + vec2(1.0,1.0) );

    float va = ddot( ga, f - vec2(0.0,0.0) );
    float vb = ddot( gb, f - vec2(1.0,0.0) );
    float vc = ddot( gc, f - vec2(0.0,1.0) );
    float vd = ddot( gd, f - vec2(1.0,1.0) );
    return vec3( va + u.x*(vb-va) + u.y*(vc-va) + u.x*u.y*(va-vb-vc+vd),   // value
                 ga + u.x*(gb-ga) + u.y*(gc-ga) + u.x*u.y*(ga-gb-gc+gd) +  // derivatives
                 du * (u.yx*(va-vb-vc+vd) + vec2(vb,vc) - va));
}

vec3 fbm( in vec2 x, in float H )
{
    float G = exp(-2.*H);
    float f = 1.0;
    float a = 1.0;
    vec3 t = vec3(0.);
    for( int i=0; i<numOctaves; i++ )
    {
        t += a*noise(f*x);
        f *= 2.0;
        a *= G;
    }
    return t;
}

vec4 laplacian(in sampler2D img, in vec2 uv, in float dx) {
  vec2 dt = 1./res;
  vec4 rg = texture(img, uv + vec2(0, 0)*dt) * -1.;
  rg += texture(img, uv + vec2(-1, -1)*dt)*(0.05+dx);
  rg += texture(img, uv + vec2(-0, -1)*dt)* (0.2-dx);
  rg += texture(img, uv + vec2(1, -1)*dt)* (0.05+dx);
  rg += texture(img, uv + vec2(-1, 0)*dt) * (0.2-dx);
  rg += texture(img, uv + vec2(1, 0)*dt) * (0.2-dx);
  rg += texture(img, uv + vec2(-1, 1)*dt) * (0.05+dx);
  rg += texture(img, uv + vec2(0, 1)*dt) * (0.2-dx);
  rg += texture(img, uv + vec2(1, 1)*dt) * (0.05+dx);

  return rg;
}
vec2 proj( in vec3 v, in vec3 ve, in vec2 tt) {
  float c = ve.z/(ve.z+v.z);
  return vec2((v.x-ve.x + tt[0]*v.z)*c, (v.y-ve.y + tt[1]*v.z)*c);
}
float dot3( in vec3 v, in vec3 w) { return v[0]*w[0] + v[1]*w[1] + v[2]*w[2]; }
vec3 rot3d( in vec3 v, in vec3 k, in float theta) { // rotation of vector v about axis k, angle t with Rodrigues formula:
  return v*cos(theta)+cross(k,v)*sin(theta)+k*dot3(k,v)*(1.-cos(theta));
}
float norm3( in vec3 v) { return sqrt(dot3(v,v)); }
vec3 flow( in vec3 r, in vec3 p) {
  return r + vec3(sin(2.*PI*rand[0]+3.*p[0]*r.x),sin(2.*PI*rand[1]+2.*p[1]*r.y),0.)*p[2]/200.;
}

void main(void) {
    vec2 dt = rc.z/res;
    vec2 uv = (u+dxy.xy-vec2(0.5))*(1.+dxy.z)+vec2(0.5);
    vec2 uc = -rc.xy + (u)*rc.z; // global coords
    vec3 ff = (0.4+0.6*kp[9])*fbm(uc+fbm(uc,1.).yz,0.4+.4*kp[0]);
    vec3 f2 = (0.4+0.6*kp[10])*fbm(-11.*kp[11]*uc+fbm(-17.*kp[10]*uc,0.7).yz,0.7-.4*kp[1]);

vec4 lp,lp2,cv,cu,cv2,cu2;
float aa,bb;

uc=uv;

vec4 cc0 = texture(img00,uv);

uc.y += kp[0]*0.2*rand[3]*ff.z*f2.x*cc0.x;//*mel1;
uc.x += kp[1]*0.2*rand[3]*ff.y*f2.x*cc0.y;//*mel1;

vec4 cc = texture(img,uc);

ff.x += .1*cc0.x;
f2.x += .1*cc0.y;

float th = ff.x;
float dtt = 1.;

vec2 dist = .5*dtt*0.01*(cc.x-cc.w)*vec2(kp[18]*cos(th)*(ff.y+kp[4]*ff.z),kp[19]*sin(th)*(ff.z-kp[4]*ff.y));
dist.xy += rand[42]*(dist.yx-dist.xy);
uc+=dist;

  aa = cc.x/256. + cc.y;
  bb = cc.z/256. + cc.w;
  lp = laplacian(img,uc,(kp[0]*2.-1.)*f2.x*(1.-aa));
  lp2 = laplacian(img,uc,(kp[1]*2.-1.)*ff.x*bb);

  uc.x += dtt*0.1*(lp.x-lp.w)*cos(th)*(ff.y+kp[4]*ff.x);
  uc.y += dtt*0.1*(lp.x-lp.w)*sin(th)*(ff.x-kp[4]*ff.y);
  uc.x += dtt*0.1*(cc.x-cc.w)*cos(th)*(ff.y+kp[4]*ff.x);
  uc.y += dtt*0.1*(cc.x-cc.w)*sin(th)*(ff.x-kp[4]*ff.y);

  cv= texture(img, uc + vec2(0, 1)*dt);
  cu= texture(img, uc + vec2(1, 0)*dt);
  cv2= texture(img, uc + vec2(0, -1)*dt);
  cu2= texture(img, uc + vec2(-1, 0)*dt);

float da = .4*(1.-kp[15])*(1.-bb)*(lp.x+256.*lp.y)/256. + 3.*( -aa*bb*bb + 0.015*(1.+kp[17])*(1.-aa))*ff.x*ff.x ;
float db = .4*(1.-kp[16])*(1.+kp[7])*(0.02+ff.x*ff.x)*aa*0.5*(lp2.z+256.*lp2.w)/256. + 3.*( aa*bb*bb - 0.04*(1.+1.*kp[6])*bb)*ff.x*ff.x;

float dda=kp[15]*0.18*((cu.x/256.+cu.y-cu2.x/256.-cu2.y)*ff.y*kp[18] + (cv.x/256.+cv.y-cv2.x/256.-cv2.y)*ff.z*kp[19]);
float ddb=kp[16]*0.18*((cu.z/256.+cu.w-cu2.z/256.-cu2.w)*f2.y*kp[18] + (cv.z/256.+cv.w-cv2.z/256.-cv2.w)*f2.z*kp[19]);

da -= .3*cc0.x*cc0.x*ff.x;
db += .3*cc0.y;

dda*=dda*6.*dtt;
ddb*=ddb*6.*dtt;
da += dda;//*(1.-dda);
db += ddb;//*(1.-ddb);

da*= 46000.;
db*= 46000.;

 da+=aa*256.*256.*.99;
 db+=bb*256.*256.*.99;

float yn = floor(da/256.); // get leading part of da and rescale
float xn = (da-yn*256.);
float wn = floor(db/256.); // get leading part of da and rescale
float zn = (db-wn*256.);

cout = vec4(xn,yn,zn,wn)/256.;
