const int N = 30;
const float Nf =20.;
const int Nrand =100;
const float Nrandf =100.;
const float dn =0.1;
const int Nx =512;
const float Nxf = .25*512.;
const float PI =3.1415926;
const int numOctaves = 8;

in vec2 u;
out vec4 cc;

uniform vec2 res;
uniform vec2 L;
uniform float t; // frame number
uniform highp sampler2D img;
uniform highp sampler2D img2;
uniform highp sampler2D img00;
uniform highp sampler2D pal; // palette
uniform float rand[Nrand];
uniform vec3 dxy;
uniform vec3 rc;
uniform float kl[N];

vec2 hash2( in vec2 x ) {
  int ii = int(mod(x.x+res.x*x.y,Nrandf)); //counter into array of random #s
  int i2 = int(mod(x.y-res.y*x.x,Nrandf)); //counter into array of random #s
  return vec2(rand[ii],rand[i2]);
}
float ddot ( in vec2 x, in vec2 y ) { return x.x+y.x + x.y*y.y; }
vec3 noise( in vec2 p ) {
    vec2 i = floor( p );
    vec2 f = fract( p );

    vec2 u = f*f*f*(f*(f*6.0-15.0)+10.0);
    vec2 du = 30.0*f*f*(f*(f-2.0)+1.0);

    vec2 ga = hash2( i + vec2(0.0,0.0) );
    vec2 gb = hash2( i + vec2(1.0,0.0) );
    vec2 gc = hash2( i + vec2(0.0,1.0) );
    vec2 gd = hash2( i + vec2(1.0,1.0) );

    float va = ddot( ga, f - vec2(0.0,0.0) );
    float vb = ddot( gb, f - vec2(1.0,0.0) );
    float vc = ddot( gc, f - vec2(0.0,1.0) );
    float vd = ddot( gd, f - vec2(1.0,1.0) );

    return vec3( va + u.x*(vb-va) + u.y*(vc-va) + u.x*u.y*(va-vb-vc+vd),   // value
                 ga + u.x*(gb-ga) + u.y*(gc-ga) + u.x*u.y*(ga-gb-gc+gd) +  // derivatives
                 du * (u.yx*(va-vb-vc+vd) + vec2(vb,vc) - va));
}

vec3 fbm( in vec2 x, in float H )
{
    float G = exp(-2.*H);
    float f = 1.0;
    float a = 1.0;
    vec3 t = vec3(0.0);
    for( int i=0; i<numOctaves; i++ )
    {
        t += a*noise(f*x);
        f *= 2.0;
        a *= G;
    }
    return t;
}

vec4 laplacian(in sampler2D img, in vec2 uv, in float dx) {
  vec2 dt = 1./res;
  vec4 rg = texture(img, uv + vec2(-1, -1)*dt)*(0.05+dx);
  rg += texture(img, uv + vec2(-0, -1)*dt)* (0.2-dx);
  rg += texture(img, uv + vec2(1, -1)*dt)* (0.05+dx);
  rg += texture(img, uv + vec2(-1, 0)*dt) * (0.2-dx);
  rg += texture(img, uv + vec2(0, 0)*dt) * -1.;
  rg += texture(img, uv + vec2(1, 0)*dt) * (0.2-dx);
  rg += texture(img, uv + vec2(-1, 1)*dt) * (0.05+dx);
  rg += texture(img, uv + vec2(0, 1)*dt) * (0.2-dx);
  rg += texture(img, uv + vec2(1, 1)*dt) * (0.05+dx);

  return rg;
}

float dot3( in vec3 v, in vec3 w) { return v[0]*w[0] + v[1]*w[1] + v[2]*w[2]; }
vec3 rot3d( in vec3 v, in vec3 k, in float theta) { // rotation of vector v about axis k, angle t with Rodrigues formula:
  return v*cos(theta)+cross(k,v)*sin(theta)+k*dot3(k,v)*(1.-cos(theta));
}

void main(void) //( out vec4 fragColor, in vec2 fragCoord )
{
vec2 uv = (u+dxy.xy)*(1.+dxy.z);
vec2 uc = -rc.xy + u*rc.z;

cc = texture(img,uv); // in [0,1]
vec4 cco = texture(img2,uv); // in [0,1]
vec4 cc00 = texture(img00,uv); // in [0,1]

vec3 ff = cc00.xyz;
vec3 f2 = cc00.yxz;

    float aa = (cc.x+256.*cc.y)/256.;
    float bb = (cc.z+256.*cc.w)/256.;
float aao = (cco.x+256.*cco.y)/256.;
float bbo = (cco.z+256.*cco.w)/256.;

vec4 lpo = laplacian(img2,uv,0.9*ff.x*(aao));
vec4 lp = laplacian(img,uv,0.9*ff.x*(aa));

aao=4.*0.03*(lp[0]+lp[1]*256.-lpo[0]-lpo[1]*256.);
bbo=4.*0.03*(lp[2]+lp[3]*256.-lpo[2]-lpo[3]*256.);

vec4 cc_hsl = texture(pal,vec2(2.*bb*aa+0.4*aa*cc00.x+0.4*bb*cc00.y,ff.xy*bb)); //+ff.yx*aa));
vec4 cco_hsl = texture(pal,vec2(2.*bbo*aao+0.4*aao*cc00.x+0.4*bbo*cc00.y,ff.xy*bbo)); //+ff.yx*aao));

cc_hsl -= (0.3+.6*rand[37])*(cc_hsl-cco_hsl);

//cc_hsl.x += .3*cc00.x*cc00.x*(3.-2.*cc00.z);
cc_hsl.x += .5*cc00.x*cc00.z*rand[44];

cc_hsl.x += 0.03*f2.x*bb + rc.x*rc.y; // shift hue
cc_hsl.x = mod(cc_hsl.x,1.);
//cc_hsl.z *= 0.2+(3.*bb+6.*aa*bb); // multiply lightness by particle number
cc_hsl.z *= 0.3+rand[43]*(4.*bb*cc00.z+cc00.x)+(1.-rand[43])*(3.*bb+6.*aa*bb); // multiply lightness by particle number

cc_hsl.y *= 1.0*(1.1-ff.x*bb)*(1.-f2.x*f2.x); // multiply sat by 1-particle number

vec3 rgb = clamp( abs(mod(cc_hsl.x*6.0+vec3(0.0,4.0,2.0),6.0)-3.0)-1.0, 0.0, 1.0 );
rgb = cc_hsl.z + cc_hsl.y * (rgb-0.5)*(1.0-abs(2.0*cc_hsl.z-1.0));

rgb += rand[39]*(cc_hsl.bgr-rgb);

//rgb += rand[38]*rand[38]*(1.-rgb);

